from selenium import webdriver
from selenium.webdriver.common.by import By
import chromedriver_autoinstaller as AutoChrome
from selenium.webdriver.chrome.service import Service
from tqdm import tqdm

# 크롬 업데이트 및 열기
def updateChrome():
    global driver
    # 크롬드라이버 버전 확인
    chrome_ver = AutoChrome.get_chrome_version().split('.')[0]

    options = webdriver.ChromeOptions()  # 브라우저 셋팅
    options.add_experimental_option("detach", True)  # 브라우저 꺼짐 방지
    options.add_argument('lang=ko_KR')  # 사용언어 한국어
    options.add_argument('disable-gpu')  # 하드웨어 가속 안함
    options.add_argument("headless") # 백그라운드 실행
    options.add_experimental_option("excludeSwitches", ['enable-logging'])  # 불필요한 에러 메세지 삭제

    # 실행 후 최신 버젼이 아니라서 실행이 안된다면 최신버젼으로 업데이트 후 재실행
    try:
        driver = webdriver.Chrome(service=Service(f'./{chrome_ver}/chromedriver.exe'), options=options)

    except:
        AutoChrome.install(True)
        driver = webdriver.Chrome(service=Service(f'./{chrome_ver}/chromedriver.exe'), options=options)

    driver.implicitly_wait(10)

# 티어별 문제 번호 따오기
def getProblem(tier):
    driver.implicitly_wait(10)
    driver.get(f"https://www.acmicpc.net/problemset?sort=no_asc&tier={tier}")
    driver.implicitly_wait(10)

    problem = []
    while 1:
        tb = driver.find_elements(By.XPATH, '//*[@id="problemset"]/tbody')
        driver.implicitly_wait(10)
        tr_count = len(tb.find_elements(By.TAG_NAME, "tr"))
        driver.implicitly_wait(10)
        for i in range(1,tr_count+1):
            problem.append(tb.find_element(By.XPATH, f'//*[@id="problemset"]/tbody/tr[{i}]/td[1]').get_attribute('textContent'))
            driver.implicitly_wait(10)
        try:
            next_page()
            driver.implicitly_wait(10)
        except:
            break
    return problem

# 다음 페이지
def next_page():
    # 다음 페이지
    driver.find_element(By.XPATH, '//*[@id="next_page"]').click()
    driver.implicitly_wait(10)

#유저 따오기
def getUser():
    driver.get("https://www.acmicpc.net/school/ranklist/275")
    driver.implicitly_wait(10)
    tb = driver.find_element(By.XPATH, '//*[@id="ranklist"]/tbody')
    driver.implicitly_wait(10)
    tr_cnt = len(tb.find_elements(By.TAG_NAME, "tr"))
    driver.implicitly_wait(10)

    ul = []
    for i in range(1, tr_cnt + 1):
        ul.append(tb.find_element(By.XPATH, f'//*[@id="ranklist"]/tbody/tr[{i}]/td[2]').get_attribute('textContent'))
        driver.implicitly_wait(10)

    return ul


# 유저가 풀이한 문제 번호 가져오기
def getUserSolvedProblem(user):
    driver.get(f"https://www.acmicpc.net/user/{user}")
    driver.implicitly_wait(10)
    solvedPS = set()
    table = driver.find_element(By.XPATH, '/html/body/div[2]/div[2]/div[3]/div[2]/div/div[2]/div[2]/div[2]/div')
    driver.implicitly_wait(10)
    a_elements = table.find_elements(By.TAG_NAME, "a")
    driver.implicitly_wait(10)
    for a_element in a_elements:
        solvedPS.add(a_element.get_attribute('textContent'))
    driver.implicitly_wait(10)

    return solvedPS

